INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300101, 3.18, 10, "フフ、全問正解よ！\nちゃんと勉強してるみたいで\n感心だわ♪", 3001, 1, 10, 7, 1, 4, 8, 1, "vo_minigame_1012_result_1000");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300102, 3.33, 10, "すごいじゃない…全問正解よ！\nま、当然といや当然よね～\nだってあたしが\n教えてやってんだから♪", 3001, 1, 10, 8, 1, 10, 7, 1, "vo_minigame_1012_result_1001");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300103, 5.41, 10, "全問正解！　パチパチパチ～♪\nこの難易度はもう完璧じゃない？\n次はもっと難しい問題に挑戦よ！\nあんたならできるって！", 3001, 1, 10, 8, 1, 10, 1, 1, "vo_minigame_1012_result_1002");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300104, 8.11, 10, "へえ…難しい問題を選んだのに\n全問正解できてるじゃない！！\nちょっとあんたすごすぎだわ…！\nパーフェクトよパーフェクト！", 3001, 1, 10, 5, 1, 10, 8, 2, "vo_minigame_1012_result_1003");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300105, 1.31, 10, "まる…まる…全部まる！\n難しい問題なのに全問正解よ…！\n驚いた…あんたいつの間に、\nこんなに勉強してたのよ！", 3001, 1, 10, 10, 1, 0, 5, 2, "vo_minigame_1012_result_1004");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300106, 4.93, 10, "ここまで完璧に正解されちゃうと\nちょっと悔しいわね…！\nけど素直に褒めてやるわ！\nえらい、えらい、えら～い！", 3001, 1, 10, 9, 1, 0, 8, 2, "vo_minigame_1012_result_1005");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300107, 2.99, 10, "すごい…あんたパーフェクトよ！\nこのままいけば次の試験、\n学年一位も夢じゃないかもね！\n楽しみだわ～♪", 3001, 1, 10, 5, 1, 4, 8, 3, "vo_minigame_1012_result_1006");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300108, 8.37, 10, "満点よ！　フフ、もうあんたに\n教えることはなにもないわ…！\n逆にあたしがあんたに教わりたい\nくらいよ！　…ね、先生♪", 3001, 1, 10, 8, 1, 4, 7, 3, "vo_minigame_1012_result_1007");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300109, 5.32, 10, "全・問・正・解！\n超難問揃いなのにすごいわね…！\nもしかしてだけど、\nあんたって天才！？", 3001, 1, 10, 7, 1, 8, 5, 3, "vo_minigame_1012_result_1008");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300110, 4.77, 7, "お、かなりいい点数ね～！\nあたしも教えがいがあるわ♪\nさ、まだまだ勉強するわよ！", 3001, 1, 9, 7, 1, 4, 1, 1, "vo_minigame_1012_result_1009");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300111, 2.97, 7, "うん、いい感じで点取れてるわ！\nこの調子で次は、\n満点を見せてほしいわね！", 3001, 1, 9, 8, 1, 4, 7, 1, "vo_minigame_1012_result_1010");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300112, 3.47, 7, "あ～惜しい！\nもうちょっとで満点じゃない！\n次はパーフェクトいけるわ！\n頑張りましょ！", 3001, 1, 9, 5, 1, 0, 1, 1, "vo_minigame_1012_result_1011");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300113, 5.32, 7, "すごい、かなりできてるわよ！\n難しい問題なのにやるじゃない！\nあとは目指せ、満点ね！", 3001, 1, 9, 8, 1, 4, 7, 2, "vo_minigame_1012_result_1012");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300114, 6.49, 7, "うん、かなりいい感じよ！\nあんたには赤点の心配なんて\nまーったくなさそうね♪\nでも勉強はやめさせないけど！", 3001, 1, 9, 8, 1, 10, 7, 2, "vo_minigame_1012_result_1013");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300115, 3.56, 7, "あーあとちょっとで\n全問正解だったのに！\n難しい問題だけどあんたなら\n次は満点狙えるわ！", 3001, 1, 9, 5, 1, 0, 1, 2, "vo_minigame_1012_result_1014");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300116, 5.67, 7, "うん、ほとんど正解よ！\nこんな難しい問題なのに、\nすごいじゃない！\nやっぱりあんた只者じゃないわ！", 3001, 1, 9, 8, 1, 10, 1, 3, "vo_minigame_1012_result_1015");
