INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300118, 3.88, 7, "うわー惜しいわね！\nもうちょっとで満点よ？\nま、あたしでも悩む難問だから、\nこの点数は胸を張っていいわ！", 3001, 1, 9, 5, 1, 0, 1, 3, "vo_minigame_1012_result_1017");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300119, 4.12, 4, "正解率は半分くらいか～\n悪くはないんだけど、あんたなら\nこんなもんじゃないでしょ？", 3001, 1, 6, 3, 1, 0, 1, 1, "vo_minigame_1012_result_1018");
