INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300121, 3.15, 4, "う～ん、正直物足りない点数ね！\nあんたには期待してんだから、\nもっと頑張んなさい！", 3001, 1, 6, 3, 1, 0, 1, 1, "vo_minigame_1012_result_1020");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300122, 5.3, 4, "半分くらいの正解率か\n難しい問題だから仕方ないわね…\nでもあんたはもっとできる！\nだってあたしがついてんのよ！", 3001, 1, 6, 9, 1, 0, 1, 2, "vo_minigame_1012_result_1021");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300123, 2.55, 4, "うん、そこそこできんじゃない！\n頑張って勉強して\nさらに上を目指しましょ！", 3001, 1, 6, 8, 1, 0, 1, 2, "vo_minigame_1012_result_1022");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300124, 4.19, 4, "難問なのにこの正解率は\nよくやってる方よね！\nでもこんなところで\n満足してんじゃないわよ！？", 3001, 1, 6, 1, 1, 0, 7, 2, "vo_minigame_1012_result_1023");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300125, 3.43, 4, "難問なのに半分くらい正解\nできてんじゃない♪\nこの調子でもっと学力\n上げていきましょ！", 3001, 1, 6, 7, 1, 0, 1, 3, "vo_minigame_1012_result_1024");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300126, 0.0, 4, "よし、平均点ってとこね！\nちゃんと勉強してるみたいで\n安心したわ～♪", 3001, 1, 6, 1, 1, 0, 1, 3, "vo_minigame_1012_result_1025");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300127, 3.72, 4, "難問揃いでこの正解率は\n大したもんよ！\nま、もっといい点取りたいんなら\n勉強、付き合ったげるわ！", 3001, 1, 6, 8, 1, 0, 7, 3, "vo_minigame_1012_result_1026");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300128, 3.5, 1, "なるほど…\nこれは教えがいがあるわね\nビシバシ鍛えてやるから\n覚悟しなさい！", 3001, 1, 3, 3, 1, 1, 2, 1, "vo_minigame_1012_result_1027");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300129, 3.25, 1, "ちょっとあんた、\n全然できてないじゃない！\n…まさかこれが本気だなんて\n言わないわよね～？", 3001, 1, 3, 4, 1, 1, 2, 1, "vo_minigame_1012_result_1028");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300130, 4.62, 1, "うーん……適当に答えても\nこれくらい正解できるわよ？\nちょっと本腰入れて\n教えないとね……！", 3001, 1, 3, 3, 1, 0, 2, 1, "vo_minigame_1012_result_1029");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300131, 4.5, 1, "…ま、まあこの問題は\nあんたには難しすぎたのかもね\nちょっとずつでいいから、\nレベルアップしていきましょ！", 3001, 1, 3, 9, 1, 0, 1, 2, "vo_minigame_1012_result_1030");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300132, 0.01, 1, "んー結構ミスっちゃってるわね…\nこのまま続けるのもいいけど、\n簡単な問題からやり直すのも\nありかもよ～？", 3001, 1, 3, 3, 1, 9, 3, 2, "vo_minigame_1012_result_1031");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300133, 0.01, 1, "あらら、あんたにはちょっと\n難しすぎたかしら…？\nもう一回やり直しましょうか！", 3001, 1, 3, 9, 1, 9, 9, 2, "vo_minigame_1012_result_1032");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300134, 0.01, 1, "うーん、残念な結果ね…\n超難問だから仕方ないけど\n無理せず簡単な問題から挑戦\nしてもいいかもよ？", 3001, 1, 3, 3, 1, 6, 3, 3, "vo_minigame_1012_result_1033");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300135, 2.97, 1, "正解率はかなり悪いわね…\nまあ難しい問題だもんね…！\nそのチャレンジ精神は買うわ！", 3001, 1, 3, 3, 1, 0, 9, 3, "vo_minigame_1012_result_1034");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300136, 3.1, 1, "なんとか０点は免れたわね…\n難問揃いだけど、\nもっと頑張っていきましょ！", 3001, 1, 3, 3, 1, 0, 1, 3, "vo_minigame_1012_result_1035");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300137, 4.31, 0, "…あんたさ、０点なんて\n逆に取るの難しいわよ！？\nまさか狙ったわけじゃ\nないでしょーね～！？", 3001, 1, 0, 6, 1, 1, 2, 1, "vo_minigame_1012_result_1036");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300138, 0.1, 0, "０点って…\nあんたふざけてんの！？\nちゃんとやらないなら\n電撃魔法くらわせるわよ！？", 3001, 1, 0, 2, 1, 1, 2, 1, "vo_minigame_1012_result_1037");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300139, 4.23, 0, "もしかしたらあんたは\n勉強向いてないのかもね…\n…勉強だけがすべてじゃないわ\n違うとこで頑張りましょ！", 3001, 1, 0, 9, 1, 9, 3, 1, "vo_minigame_1012_result_1038");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300140, 4.38, 0, "怒んないから正直に言って？\n…ふざけて答えたでしょ？\nほら、正直に\n言・い・な・さ・い？", 3001, 1, 0, 3, 1, 0, 2, 2, "vo_minigame_1012_result_1039");
