INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300145, 6.58, 10, "うん正解率は申し分なしね！\nあとはもっと早く解ければ\nもっと点数は伸びてくわよ！\nこの調子で頑張っていきましょ！", 3001, 2, 14, 1, 1, 0, 8, 3, "vo_minigame_1012_result_1077");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300146, 4.24, 5, "ふ～ん、まあまあの出来だわ\n悪くはないんだけど…あんたには\nもっともっと期待してるわ～", 3001, 2, 9, 1, 1, 0, 7, 1, "vo_minigame_1012_result_1078");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300147, 4.74, 5, "うん、頑張ったけど…\n正直もっと正解できるかもね～？\nこんなのあんたには通過点！\nさらに良い点目指してみない？", 3001, 2, 9, 7, 1, 0, 1, 1, "vo_minigame_1012_result_1079");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300148, 0.0, 5, "まあまあな点数だけど、\n自分的に手ごたえはどう？\nダメだって思ってんなら、\nまだまだ伸びる余地ありね！", 3001, 2, 9, 1, 1, 0, 1, 1, "vo_minigame_1012_result_1080");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300149, 2.21, 5, "うん、中々の出来ね！\nでもあんたはもっといい点\n取れるはずよ！\nもっと頑張りましょうか！", 3001, 2, 9, 8, 1, 0, 1, 2, "vo_minigame_1012_result_1081");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300150, 2.46, 5, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 3001, 2, 9, 3, 1, 0, 1, 2, "vo_minigame_1012_result_1082");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300151, 2.94, 5, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 3001, 2, 9, 3, 1, 0, 1, 2, "vo_minigame_1012_result_1083");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300152, 4.19, 5, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 3001, 2, 9, 7, 1, 0, 1, 3, "vo_minigame_1012_result_1084");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300153, 0.0, 5, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 3001, 2, 9, 1, 1, 0, 1, 3, "vo_minigame_1012_result_1085");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300154, 2.63, 5, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 3001, 2, 9, 3, 1, 0, 1, 3, "vo_minigame_1012_result_1086");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300155, 5.53, 1, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 3001, 2, 4, 3, 1, 0, 1, 1, "vo_minigame_1012_result_1087");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300156, 0.01, 1, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 3001, 2, 4, 3, 1, 9, 3, 1, "vo_minigame_1012_result_1088");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300157, 4.15, 1, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", 3001, 2, 4, 3, 1, 3, 1, 1, "vo_minigame_1012_result_1089");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300158, 0.01, 1, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 3001, 2, 4, 9, 1, 9, 9, 2, "vo_minigame_1012_result_1090");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300159, 5.37, 1, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 3001, 2, 4, 3, 1, 0, 1, 2, "vo_minigame_1012_result_1091");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300160, 1.44, 1, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～", 3001, 2, 4, 3, 1, 0, 1, 2, "vo_minigame_1012_result_1092");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300161, 0.0, 1, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 3001, 2, 4, 3, 1, 0, 3, 3, "vo_minigame_1012_result_1093");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300162, 2.91, 1, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！", 3001, 2, 4, 3, 1, 3, 9, 3, "vo_minigame_1012_result_1094");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300163, 2.61, 1, "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！", 3001, 2, 4, 5, 1, 0, 1, 3, "vo_minigame_1012_result_1095");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300164, 3.63, 0, "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！", 3001, 2, 0, 4, 1, 1, 2, 1, "vo_minigame_1012_result_1096");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300165, 4.16, 0, "はあ…自分で何点取ったか\n分かってるわよね～…？\n０点よ０点！　舐めてんの！？", 3001, 2, 0, 6, 1, 1, 2, 1, "vo_minigame_1012_result_1097");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300166, 0.01, 0, "うう～頭痛い…\nあんたのせいよ！\nなに０点って！\nはあ、このままじゃ赤点よ～…", 3001, 2, 0, 3, 1, 6, 3, 1, "vo_minigame_1012_result_1098");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300167, 5.75, 0, "ねえ、あんた本気でやったの？\nまさか適当にやるわけないわよね\n…分かった、\nもう一回チャレンジするのよ！", 3001, 2, 0, 6, 1, 0, 2, 2, "vo_minigame_1012_result_1099");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300168, 5.64, 0, "あ…あんた、０点よ０点…！\nあたしの教え方が悪かった…？\n…燃えてきたわ！\n絶対あんたの学力上げてやる！", 3001, 2, 0, 4, 1, 1, 2, 2, "vo_minigame_1012_result_1100");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300169, 5.73, 0, "ちょっと待って採点ミスかも…\n…いや合ってるわね。はい０点\n…って０点！？\nふざけんなーー！", 3001, 2, 0, 8, 1, 8, 4, 2, "vo_minigame_1012_result_1101");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300170, 5.32, 0, "あらら…０点よ\nま、難しい問題だしね…\n…つっても０点は無いわ！\n一問くらい正解しなさいよ！", 3001, 2, 0, 5, 1, 1, 3, 3, "vo_minigame_1012_result_1102");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300171, 2.37, 0, "残念だけど０点よ\nま、まあ前向きにとらえるなら、\n今が底よ！　どん底！\nあとは上がってくだけね！", 3001, 2, 0, 3, 1, 9, 9, 3, "vo_minigame_1012_result_1103");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300172, 4.25, 0, "…かなり出来が悪いわね\n一旦休憩しましょうか？\nリフレッシュして頭切り替えて\nもう一度頑張りましょう！", 3001, 2, 0, 9, 1, 3, 1, 3, "vo_minigame_1012_result_1104");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (13100101, 0.0, 0, "さ、勉強を始めるわよ", 1001, 3, 0, 7, 1, 0, 7, 0, "vo_minigame_1012_gamestart_100");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (13100102, 0.0, 0, "よし、勉強の成果を見てやるわ！", 1001, 3, 0, 1, 1, 0, 1, 0, "vo_minigame_1012_gamestart_101");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (13100103, 1.82, 0, "じゃあ試験するわよ。はい教科書閉じて！", 1001, 3, 0, 1, 1, 0, 7, 0, "vo_minigame_1012_gamestart_102");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (13100201, 0.01, 3, "やる気マンマンじゃない！", 1002, 3, -1, 8, 1, 4, 8, 0, "vo_minigame_1012_gamestart_103");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (13100202, 0.0, 3, "よし、じゃあもう一回やるわよ！", 1002, 3, -1, 1, 1, 0, 1, 0, "vo_minigame_1012_gamestart_104");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (13100301, 0.0, 1, "普通の難易度よ！", 1003, 3, 1, 0, 1, 0, 0, 0, "vo_minigame_1012_gamestart_105");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (13100302, 0.0, 1, "まずは基本からね！", 1003, 3, 1, 7, 1, 0, 7, 0, "vo_minigame_1012_gamestart_106");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (13100303, 0.0, 2, "難しい問題に挑戦するのね！", 1003, 3, 2, 10, 1, 0, 10, 0, "vo_minigame_1012_gamestart_107");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (13100304, 0.67, 2, "よし、あんたならできるわ！", 1003, 3, 2, 1, 1, 0, 8, 0, "vo_minigame_1012_gamestart_108");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (13100305, 0.0, 3, "あたしでも手こずる難問揃いよ…！", 1003, 3, 3, 5, 1, 0, 5, 0, "vo_minigame_1012_gamestart_109");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (13100306, 0.0, 3, "激ムズだけど頑張んなさい！", 1003, 3, 3, 2, 1, 0, 2, 0, "vo_minigame_1012_gamestart_110");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (13100401, 0.0, 0, "鉄は熱いうちに打て、\n…ってね♪", 1004, 3, 0, 7, 1, 0, 7, 0, "vo_minigame_1012_gamestart_111");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (13100402, 0.0, 0, "よし、もっぺんやるわよ！", 1004, 3, 0, 1, 1, 0, 1, 0, "vo_minigame_1012_gamestart_112");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (13100501, 0.0, 0, "スズナもちゃんと勉強してるみたいね～", 1005, 3, 0, 9, 1, 0, 9, 0, "vo_minigame_1012_gamestart_113");
