INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (21300101, 3.32, 10, "すご、全部〇じゃん…！\nこの調子で教えてくれたら\nうちも頭よくなりそー！", 3001, 1, 10, 6, 2, 0, 0, 1, "vo_minigame_1012_result_2000");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (21300102, 6.5, 10, "え、〇しかなかった…？\n満点ってほんとにあるんだ…\nヒデサイマジすごい…！", 3001, 1, 10, 6, 2, 3, 2, 1, "vo_minigame_1012_result_2001");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (21300103, 3.1, 10, "満点じゃん！　やりー！\nもしかしてヒデサイには\n簡単過ぎた感じ？", 3001, 1, 10, 3, 2, 5, 6, 1, "vo_minigame_1012_result_2002");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (21300104, 2.06, 10, "ビシッと決まったね！\nヒデサイ、ベンキョー\n教えてくれてありがとー♪", 3001, 1, 10, 3, 2, 11, 2, 2, "vo_minigame_1012_result_2003");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (21300105, 4.45, 10, "ムズい問題もぜーんぶ正解！\n激アツじゃん！\nヒデサイ、頭よすぎ～", 3001, 1, 10, 3, 2, 0, 7, 2, "vo_minigame_1012_result_2004");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (21300106, 0.01, 10, "きゃはっ、満点じゃん！\n一緒にベンキョーしてる\nうちまでいい気分！", 3001, 1, 10, 2, 2, 11, 2, 2, "vo_minigame_1012_result_2005");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (21300107, 6.64, 10, "ヒデサイ、満点パーフェクト！\nこれで、もーサイツヨだね！\nそれっ、ハイタッチ～！", 3001, 1, 10, 2, 2, 11, 3, 3, "vo_minigame_1012_result_2006");
