INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (21300109, 5.76, 10, "おにムズでも満点じゃん…！\nヒデサイセンセーマジすごい！\nこれからも頼りにしてるよ～", 3001, 1, 10, 6, 2, 0, 7, 3, "vo_minigame_1012_result_2008");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (21300110, 0.0, 7, "ヒデサイ、もしかして\nよゆーな感じ？\n正解しまくりじゃん！", 3001, 1, 9, 6, 2, 0, 6, 1, "vo_minigame_1012_result_2009");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (21300111, 2.59, 7, "〇いっぱいで、わろ～\nてかヒデサイ教えるのうまっ！\nめちゃわかりやすかったよ♪", 3001, 1, 9, 2, 2, 0, 7, 1, "vo_minigame_1012_result_2010");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (21300112, 4.09, 7, "これだけ〇あったら、\nめちゃ気持ちいいね♪\n次は満点取っちゃおー！", 3001, 1, 9, 2, 2, 11, 3, 1, "vo_minigame_1012_result_2011");
