INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (21300123, 2.38, 4, "あともう半分だね！\nフレッフレッ、ヒデサイ！\nうちもがんばる～！", 3001, 1, 6, 0, 2, 0, 2, 2, "vo_minigame_1012_result_2022");
