INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (21300125, 2.25, 4, "だいたい半分正解？\nとゆーことは\nあと半分で満点じゃん！", 3001, 1, 6, 0, 2, 0, 6, 3, "vo_minigame_1012_result_2024");
