INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (21300127, 3.75, 4, "おにムズだったのに\n半分解けてる…！？\nヒデサイいい感じ！", 3001, 1, 6, 6, 2, 0, 2, 3, "vo_minigame_1012_result_2026");
