INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (21300130, 2.93, 1, "ウォーミングアップは\nこんなところで…\nヒデサイ、次は\n本気出しちゃおうよ！", 3001, 1, 3, 0, 2, 0, 3, 1, "vo_minigame_1012_result_2029");
