INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (21300141, 5.8, 0, "これ、うちら習ったっけ？\nヒデサイも覚えてない感じ？\nじゃあ仕方ないっしょ！\n次いこ次！", 3001, 1, 0, 6, 2, 4, 2, 2, "vo_minigame_1012_result_2040");
