INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300154, 6.15, 5, "やっぱテストって\nなんとなくじゃ無理？\n覚えるしかないの？\nじゃあがんばるしかないね…", 3001, 2, 9, 9, 2, 0, 5, 3, "vo_minigame_1012_result_2086");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300155, 4.12, 1, "できたと思ったけど\nそーじゃなかった系？\nテストってマジきびしー…", 3001, 2, 4, 4, 2, 6, 9, 1, "vo_minigame_1012_result_2087");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300156, 0.01, 1, "うーん…さっぱり！\nでも簡単な問題なんだよね…？\nもっかいやってみる？", 3001, 2, 4, 4, 2, 6, 4, 1, "vo_minigame_1012_result_2088");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300157, 5.28, 1, "うちらまだまだ\nベンキョーちうだし…\nこれからだよねっ？\nね、ヒデサイ！", 3001, 2, 4, 0, 2, 0, 3, 1, "vo_minigame_1012_result_2089");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300158, 2.89, 1, "ちょっとずつ覚えれば\nおーけーっしょ！\nうちと一緒に\nベンキョーだね！", 3001, 2, 4, 0, 2, 0, 3, 2, "vo_minigame_1012_result_2090");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300159, 5.45, 1, "うちベンキョー苦手でも\nヒデサイとベンキョー\nするのは好き！　だから\nもっかい教えてくれる？", 3001, 2, 4, 0, 2, 0, 7, 2, "vo_minigame_1012_result_2091");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300160, 4.29, 1, "覚えても、すぐ忘れるんだけど\nどしたらいい？\nあ、そーゆうとき\nフクシューする感じ？", 3001, 2, 4, 4, 2, 3, 10, 2, "vo_minigame_1012_result_2092");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300161, 4.64, 1, "ムズ過ぎ！\n頭パンクするかと思った…！\nヒデサイ、うちの頭\nふぅふぅして～", 3001, 2, 4, 4, 2, 6, 8, 3, "vo_minigame_1012_result_2093");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300162, 3.14, 1, "おにムズ過ぎてテンサゲ～\nでもヒデサイがんばってるし\nうちもがんばる！", 3001, 2, 4, 9, 2, 0, 5, 3, "vo_minigame_1012_result_2094");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300163, 6.59, 1, "ヒデサイと同じ点数で\nちょっち安心したかも\n一緒にがんばろーね！\n置いてっちゃやだよ？", 3001, 2, 4, 7, 2, 0, 4, 3, "vo_minigame_1012_result_2095");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300164, 0.0, 0, "…まあ、これより下はないし\n次は大逆転\n点数爆上がりっしょ！", 3001, 2, 0, 3, 2, 0, 3, 1, "vo_minigame_1012_result_2096");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300165, 2.2, 0, "０点じゃん…\nそだ、次はえんぴつ転がして\n選ぶ作戦やってみる？", 3001, 2, 0, 9, 2, 5, 10, 1, "vo_minigame_1012_result_2097");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300166, 0.01, 0, "考えるの無理な時あるよね…\nヒデサイもそーゆう\n感じだったの？", 3001, 2, 0, 4, 2, 6, 4, 1, "vo_minigame_1012_result_2098");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300167, 2.8, 0, "え、ヒデサイも０点？\nじゃあうちと一緒じゃん♪\nまあ焦んないで\nベンキョーしてこーよ！", 3001, 2, 0, 6, 2, 3, 2, 2, "vo_minigame_1012_result_2099");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300168, 3.22, 0, "むむむ～…０点…！\n覚えてもすぐ忘れちゃうし\nベンキョーってマジ大変", 3001, 2, 0, 9, 2, 6, 4, 2, "vo_minigame_1012_result_2100");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300169, 2.1, 0, "０点だね…\nでも、へーきへーき\nリベンジしたら、結果オーライ！", 3001, 2, 0, 4, 2, 11, 0, 2, "vo_minigame_1012_result_2101");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300170, 2.74, 0, "おやつ休憩して\nリベンジしよっ！\n甘いの食べたら、イケるっしょ！", 3001, 2, 0, 0, 2, 3, 2, 3, "vo_minigame_1012_result_2102");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300171, 3.0, 0, "ヒデサイでも\nおにムズな感じ？\nじゃあ、このテスト\n誰も解けなくない？", 3001, 2, 0, 6, 2, 9, 9, 3, "vo_minigame_1012_result_2103");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300172, 4.37, 0, "…あれ？\n０が〇に見えてきた！\nきゃはっ、ちょっち\nやる気出てきたかも！", 3001, 2, 0, 10, 2, 0, 2, 3, "vo_minigame_1012_result_2104");
